import React from "react";


function Header() {
    return (
        <div>
            <Container>
    <header>
      <Navbar expand="lg" variant="light" bg="light">
        <Container>
          <Navbar.Brand href="#"> Explore Uttarakhand </Navbar.Brand>
        </Container>
      </Navbar>
      </header>
    </Container>
            


        </div>

    );
}


export default Header;
